const tasks = [
    {
        id:1,
        text: 'Doctors Appointment',
        day: 'July 1st at 2:30pm',
        reminder: true,
    },
    {
        id:2,
        text: 'Grocery Shopping',
        day: 'July 1st at 6:30pm',
        reminder: true,
    },
    {
        id:3,
        text: 'Meeting at School',
        day: 'July 4th at 2:30pm',
        reminder: false,
    }
]

const Tasks = () => {
    return (
        <>
            {tasks.map((task)=>(<h3 key = {task.id}>{task.text}</h3>))}
        </>
    )
}

export default Tasks
